		"column",
		"reverse",
		"noWrap",
		"wrapReverse",
		"grow"
	),
	{
		tag: {
			type: String,
			default: "div",
		},
		justify: {
			type: String,
			default: null,
			validator: type => JustifyContent.indexOf(type) !== -1,
		},
		align: {
			type: String,
			default: null,
			validator: type => AlignItems.indexOf(type) !== -1,
		},
