		alignH: {
			type: String,
			default: null,
			validator: type => AlignAxes.indexOf(type) !== -1,
		},
		// Cannot prefix with `v` because it's parsed as directive.
		alignV: {
			type: String,
			default: null,
			validator: type => AlignAxes.indexOf(type) !== -1,
		},
	}
);

